import React, { useState } from 'react';
import ProductList from './ProductList'; // Componente que lista os produtos
import CreateProduct from './components/CreateProduct'; // Componente para criar produtos

function App() {
  const [currentTab, setCurrentTab] = useState('list'); // Aba ativa

  return (
    <div>
      <nav>
        <button onClick={() => setCurrentTab('list')}>Lista de Produtos</button>
        <button onClick={() => setCurrentTab('create')}>Criar Produto</button>
      </nav>
      <main>
        {currentTab === 'list' && <ProductList />}
        {currentTab === 'create' && <CreateProduct />}
      </main>
    </div>
  );
}

export default App;
